import React from 'react';
import '../stylesheets/App.css';
import PokemonList from './PokemonList';
import data from '../data/data.json';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {data}
  }


  render() {
    return (
      <div className="App">
        <PokemonList items={this.state.data}/>
      </div>
    );
  }
}

export default App;
